.portfolio {
  .btn-container {
    margin: 1em auto;
    button {
      margin: 0.5em;
    }
  }
  .project-grid {
    display: grid;
    grid-gap: 1rem;
    grid-template-columns: repeat(auto-fit, minmax(400px, 1fr));
  }
}
// about
.about-wrapper {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  margin-top: 2em;
  .about-content {
    width: 55%;
    p {
      margin-bottom: 1.2rem;
    }
  }
  .about-image {
    width: 40%;

    img {
      max-width: 100%;
      max-height: 20em;
      object-fit: cover;
      box-shadow: #111 0 0 10px;
    }
  }
}
// contact
.contact {
  flex-wrap: wrap;
  .form-container {
    display: flex;
    flex-direction: column;
    max-width: 30em;
    margin-top: 2em;
    button {
      width: 100%;
    }
  }
  .form-container > form *:not(button) {
    margin: 2% 0;
    color: $off-white;
  }
  .form-container > form input,
  .form-container > form textarea {
    width: 100%;
    background: $grape;
    border: none;
    margin-bottom: 1em;
    padding: 1rem;
    &::placeholder {
      color: fade-out($off-white, 0.6);
    }
  }
  .form-container > form textarea {
    max-height: 50em;
    height: 10em;
    resize: vertical;
  }
}

